import React from "react";
import "./footer.css";

const Footer = () => {
  return <div>

    <footer className="footer">
      <div className="footer__box box-1">
        <ul className="footer__items">
          <li className="footer__list">WHO WE ARE</li>
          <li className="footer__list">WHAT WE DO</li>
          <li className="footer__list">WORK</li>
          <li className="footer__list">INSIGHT</li>
          <li className="footer__list">PARTNERS</li>
          <li className="footer__list">CONTACT</li>
          <li className="footer__list">PRIVACY POLICY</li>
          <li className="footer__list">TERMS % CONDITIONS</li>
        </ul>
      </div>
      <div className="footer__box box-2"></div>
      <div className="footer__box box-3"></div>


    </footer>
  </div>;
};

export default Footer;
